import React from 'react'
import {useState,useEffect} from 'react';
import {axios} from 'axios';


function ShowAllData(Data) {
    const [users,setUsers]=useState([]);
    

    const LoadData=async ()=>{
        try{
            const newdata=await axios.get("http://localhost:3005/users");
            console.log(newdata.data);
        }
        catch(error)
        {
            console.log(error);
        }
     
    }

    useEffect(()=>{
     LoadData();
    },[])
  return (
   <>
   <table>
    <thead>
        <th>Name</th>
        <th>UserName</th>
        <th>Email</th>
    </thead>
    <tbody>
        {
            users.map((current,id)=>{
                return(
                    <>
                    <tr>{current.name}</tr>
                    <tr>{current.username}</tr>
                    <tr>{current.email}</tr>
                    </>
                )
            })
        }
    </tbody>
   </table>
    </>
  )
}

export default ShowAllData
